<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Verify Proof</title>
</head>
<body>
    <div style="text-align: center; margin-top: 50px;">
        <p style="color: red; font-weight: bold;">Verify Proof transaction details are not appearing</p>
        <button onclick="verifyProofInitial()" style="margin-top: 20px;">Verify Proof</button>
        <p id="result"></p>
    </div>

    <div style="text-align: center; margin-top: 50px;">
        <p style="color: green; font-weight: bold;">Deposit transaction details are appearing</p>
        <button onclick="Deposit()" style="margin-top: 20px;">Deposit</button>
        <p id="result"></p>
    </div>

    <p style="text-align: center; color: blue; margin-top: 20px; font-style: italic;">
        Verify Proof transaction details are not appearing despite having the same transaction details as Deposit
    </p>

    <script>

        class TransactionsDetail {
            constructor(walletAddress) {
                this.cairoVersion = "2.8.0";
                this.walletAddress = walletAddress;
                this.maxFee = "0x100000000000";
                this.version = "0x1";
                this.chainId = "0x534e5f5345504f4c4941";
                this.nonce = "0x0";
            }
        }

        class PrepareTransaction {
            constructor(transactions, transactionsDetail) {
                this.transactions = transactions;
                this.transactionsDetail = transactionsDetail;
            }

            static async new(transactions, walletAddress) {
                const transactionsDetail = new TransactionsDetail(walletAddress);
                
                if (window.starknet && window.starknet.account) {
                    const nonce = await window.starknet.account.getNonce();
                    transactionsDetail.nonce = nonce;
                }

                return new PrepareTransaction(
                    transactions.map(([contractAddress, entrypoint, calldata]) => ({
                        contractAddress,
                        entrypoint,
                        calldata
                    })),
                    transactionsDetail
                );
            }
        }

        async function verifyProofInitial() {

            if (!window.starknet) {
                alert('Please install ArgentX wallet and refresh the page');
                return;
            }

            try {
                await window.starknet.enable();
                
                await new Promise(resolve => setTimeout(resolve, 2000));
                
                if (!window.starknet.account) {
                    throw new Error('Please connect your wallet first');
                }

                const starknetProvider = window.starknet;
                const walletAddress = starknetProvider.account.address;

                const jobId = "0x" + Math.floor(Math.random() * Number.MAX_SAFE_INTEGER).toString(16);
                const proofText = await proof_array.text();

                const proofArray = proofText
                    .split(/\s+/)
                    .flatMap(s => {
                        if ((s.match(/0x/g) || []).length > 1) {
                            return s.split('0x')
                                .filter(part => part !== '')
                                .map(part => '0x' + part);
                        }
                        return [s];
                    })
                    .map(s => s.startsWith('0x') ? s : '0x' + s);
                
                const verifier_config_text = await verifier_config.text();
                const verifier_config_array = verifier_config_text.split(' ').map(item => {
                    return item.startsWith('0x') ? item : BigInt(item);
                });

                const initialCalldata = [
                    jobId,
                    ...verifier_config_array,
                    ...proofArray
                ];

                const preparedTransaction = await PrepareTransaction.new([
                    [
                        "0x03e7f1de1fb282a222624bb5da8dfd34368f2f31a3e9d742a980062510d5cc41",
                        "verify_proof_initial",
                        initialCalldata
                    ]
                ], walletAddress);

                console.log('Prepared transaction:', preparedTransaction);

                const initial_result = await starknetProvider.account.execute(
                    preparedTransaction.transactions,
                    preparedTransaction.transactionsDetail
                );

                document.getElementById('result').innerHTML = `
                    <div class="success-message">
                        <h3>Transaction Submitted</h3>
                        <pre>${JSON.stringify(initial_result, null, 2)}</pre>
                        <div class="transaction-details">
                            <h4>Transaction Details:</h4>
                            <pre>${JSON.stringify(preparedTransaction.transactionsDetail, null, 2)}</pre>
                        </div>
                    </div>
                `;
            } catch (error) {
                document.getElementById('result').innerHTML = `
                    <div style="color: red; padding: 10px;">
                        Error: ${error.message}
                        <br>
                        Please try again in a few seconds.
                    </div>
                `;
            }
        }

        async function Deposit() {
            if (!window.starknet) {
                alert('Please install ArgentX wallet and refresh the page');
                return;
            }

            try {
                await window.starknet.enable();
                
                await new Promise(resolve => setTimeout(resolve, 2000));
                
                if (!window.starknet.account) {
                    throw new Error('Please connect your wallet first');
                }

                const starknetProvider = window.starknet;
                const walletAddress = starknetProvider.account.address;
                const preparedTransaction = await PrepareTransaction.new([
                    [
                        "0x354593c6291013ece3106c573f882a3a41dc08b5715cf9d7be2bbb9eab2b8d9",
                        "deposit",
                        ["0x1", "0x2"]
                    ]
                ], walletAddress);

                console.log('Prepared transaction:', preparedTransaction);

                const initial_result = await starknetProvider.account.execute(
                    preparedTransaction.transactions,
                    preparedTransaction.transactionsDetail
                );

                document.getElementById('result').innerHTML = `
                    <div class="success-message">
                        <h3>Transaction Submitted</h3>
                        <pre>${JSON.stringify(initial_result, null, 2)}</pre>
                        <div class="transaction-details">
                            <h4>Transaction Details:</h4>
                            <pre>${JSON.stringify(preparedTransaction.transactionsDetail, null, 2)}</pre>
                        </div>
                    </div>
                `;
            } catch (error) {
                document.getElementById('result').innerHTML = `
                    <div style="color: red; padding: 10px;">
                        Error: ${error.message}
                        <br>
                        Please try again in a few seconds.
                    </div>
                `;
            }
        }
